const Checkbox=({name, checked = true, handelCheck, keyvalue }) =>{
  return (
    <div>
      <label className="label">
        <input
          type="checkbox"
          name = {name}
          checked={checked}
          onChange={handelCheck}
        />
        {keyvalue}
      </label>
    </div>
  );
}
export default Checkbox;
